  b 05.11.1956
  b 18.07.1967
  Martin b. at Waipukurau. Tina, d/o Christopher Carr-Smith and Janette Pountney. Address:
  "Pukewhau", Bulls Road, RD 3, Kerikeri.
  Martin was educated at Flemington School and Christ's College, Christchurch (School Prefect, Head
  of School House), He was a member of the school band and for 4 years was trombonist with the
  Secondary Schools Representative Band. He attended Auckland University in 1975 and Victoria
  University in 1976 before travelling overseas for nearly two years. He bought land in Kerikeri in
  1980 and managed and leased kiwifruit orchards for ten years, until 1994. Since then he has been
  market gardening organically. Martin was Vice-Chairman of the Kerikeri Community Board.
