  Guy was educated at Flemington School and Christ's College, Christchurch. He was in the 1st rowing
  eight, captain of basketball, senior athletic champion and School Prefect all in 1975. He served in
  the Territorial Army to the rank of Lieutenant. Guy is a farmer.
